import {ReactComponent as Explore} from '../../assets/explore.svg';
import './Header.css';
const Header = ({history,isLogged}) =>{
    const handleClick=() =>{
        history.push('/')
        isLogged(false)
    }
    return(
            <div >
                <h1>Crowdsource Gift Website</h1><br/>
            </div>
    )
}

export default Header;
